import React from "react";
function HelloDiv() {
  return (<div>
    <h1>Hello! My name is Elizabeth</h1>;
    <p>Things I Like</p>
    <ul>
      Travel
      Hiking
      Coffee
    </ul>
    </div>
  )}

export default HelloDiv;
